import React from "react";
import { createBrowserRouter, Navigate } from "react-router-dom";
import App from "./App";
import Authentication from "./pages/Authentication";
import ErrorPage from "./pages/ErrorPage";
import About from "./pages/About";
import ProtectedRoute from "./ProtectedRoute";
import AnalyticsPage from "./pages/AnalyticsPage";

// Create router configuration
const router = createBrowserRouter([
  {
    path: "/",
    element: <App />, // Main layout, determines when to show Authentication or child routes
    errorElement: <ErrorPage />,
    children: [
      { path: "login", element: <Authentication /> },
      { path: "signup", element: <Authentication /> },
      { path: "about", element: <About /> },
      {
        path: "analytics",
        element: <ProtectedRoute element={<AnalyticsPage />} />, // Protected Analytics page
      },
    ],
  },
  { path: "*", element: <ErrorPage /> }, // Catch-all for unmatched routes
]);

export default router;
